- news published on website of Superior Council of Magistracy (https://www.csm1909.ro);
- possibility to filter news based on wanted categories;
- push notification alerts.

Главные новости страны и мира в мобильном приложении от ведущего информационного агентства России.

— всё важное за день;
— курсы доллара и евро (с сайта московской биржи);
— уведомления о самых важных новостях;
— сохранение новостей в избранное;
